import { React, useContext, useEffect } from 'react'
import NoteContext from '../context/notes/noteContext'

const About = () => {
  const a = useContext(NoteContext)
  useEffect(() => {
    const update =()=>{
      setTimeout(() => {
          setState({
              "name": "Biswas",
              "class": "3rd yr"
          })
      }, 1000);
  }
  update()
  }, [])
  
  return (
    <div>
      this is about {a.name} and he is in class {a.class}
    </div>
  )
}

export default About;
